// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.18;

contract PaymentSystem {
    mapping(address => uint256) public balances;

    event PaymentMade(address indexed payer, address indexed recipient, uint256 amount);

    constructor() {
        balances[0x5B38Da6a701c568545dCfcB03FcB875f56beddC4] = 1000 ether; // Ganache account 1
        balances[0xAb8483F64d9C6d1EcF9b849Ae677dD3315835cb2] = 1000 ether; // Ganache account 2
    }

    function makePayment(address recipient, uint256 amount) external {
        require(amount > 0, "Invalid amount");
        require(balances[msg.sender] >= amount, "Insufficient balance");

        balances[msg.sender] -= amount;
        balances[recipient] += amount;

        emit PaymentMade(msg.sender, recipient, amount);
    }

    function getBalance(address account) external view returns (uint256) {
        return balances[account];
    }
}

